import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

let Navbar = styled.div`
    color: white;
    display: flex;
    justify-content: flex-end;
    width: 100%;

`
let Login = styled.div`
    background-color: white;
    margin: 10px 10px;
    padding: 10px;
    border-radius: 10px;
    & > * {
        color: #6e6e6e;
        font-weight: 500;
        text-decoration: none;
    }
`

let Signup = styled.div`
    padding: 10px;
    border-radius: 10px;
    text-decoration: none;
    background-color: magenta;
    margin: 0px 10px;
    & > * {
        color: white;
        font-weight: 500;
        text-decoration: none;
    }
`

const Nav = () => {
    return (
        <Navbar>
            <Login><Link to="/auth/login">Login</Link></Login>
            <Signup><Link to="/auth/signup">Sign up</Link></Signup>
        </Navbar>
    );
};

export default Nav;
